//package com.sincetimes.redwar.game.comnunicate.protocol;


message RseQueryStarsBookmarks
{
	repeated Bookmarks Bookmarks = 1;
}

message Bookmarks
{
    optional int32 starName = 1; //": "毛里求斯",
    optional string sku = 2; //": "2:0",
    optional int32 starType = 3; //": 1,
    optional int32 starId = 4; //": 2031,
}
